rna = " "
sliced_rna = [rna[i:i+3] for i in range(0, len(rna), 3)]
protein = ''

for aminoacid in sliced_rna:
    if len(aminoacid) == 3:
        match aminoacid:
            case 'AUG':
                protein += 'M'
            case 'UGG':
                protein += 'W'
            case 'CAU' | 'CAC':
                protein += 'H'
            case 'AAU' | 'AAC':
                protein += 'N'
            case 'UAU' | 'UAC':
                protein += 'Y'
            case 'GAU' | 'GAC':
                protein += 'D'
            case 'CAA' | 'CAG':
                protein += 'Q'
            case 'GAA' | 'GAG':
                protein += 'E'
            case 'UUU' | 'UUC':
                protein += 'F'
            case 'UGU' | 'UGC':
                protein += 'C'
            case 'AAA' | 'AAG':
                protein += 'K'
            case 'AUU' | 'AUC' | 'AUA':
                protein += 'I'
            case 'GUU' | 'GUC' | 'GUA' | 'GUG':
                protein += 'V'
            case 'GCU' | 'GCC' | 'GCA' | 'GCG':
                protein += 'A'
            case 'CCU' | 'CCC' | 'CCA' | 'CCG':
                protein += 'P'
            case 'ACC' | 'ACU' | 'ACA' | 'ACG':
                protein += 'T'
            case 'GGU' | 'GGC' | 'GGA' | 'GGG':
                protein += 'G'
            case 'UCU' | 'UCC' | 'UCA' | 'UCG' | 'AGU' | 'AGC':
                protein += 'S'
            case 'CGU' | 'CGC' | 'CGA' | 'AGA' | 'CGG' | 'AGG':
                protein += 'R'     
            case 'CUU' | 'CUC' | 'CUA' | 'UUA' | 'UUG' | 'CUG':
                protein += 'L'
                
print(protein)